import './App.css';

function App() {
  const title = "welcome to the new blog";
  const likes = 50;


  return (
    <div className="App">
      <div className="content">
        <h1>{title}</h1>
        <p>Liked {likes} times</p>
        <p>{10}</p>
      </div>
    </div>
  );
}

export default App;
